import requests
from bs4 import BeautifulSoup


def find_org(ids, result):
    temp = []
    cookies = {'SSTSESSID': 's1pflv00ddc2cta4bat6ipl3ka'}
    headers = {}
    params = {}
    for id in ids:
        response = requests.get('https://staff-info.rakuten-it.com/organizations/' + id, headers=headers, params=params,
                                cookies=cookies)
        # print(response.text)
        soup = BeautifulSoup(response.text, 'html.parser')
        # 爬取内容
        content = "#org_child > div.col-sm-10.card-columns > div > div"
        id_h = "#org_child > div.col-sm-10.card-columns > div > div > a:nth-child(2)"
        # 清洗数据
        # print(soup)
        content_handle = soup.select(content)
        ids_handle = soup.select(id_h)
        for i in range(0, len(content_handle)):
            print(i)
            print(content_handle[i].text.strip().replace(' ', '').replace('\n', '-'))
            ids_handle[i] = ids_handle[i].text.strip()
            temp.append(content_handle[i].text.strip().replace(' ', '').replace('\n', '-'))
        result[id] = temp
        print(ids_handle)
        find_org(ids_handle, result)
    print(result)



